import React from "react";
import ReactDom from "react-dom/client";
import "./App.css";

const Header = () => {
  return (
    <header>
      <p>ArtistBlender</p>
      <p>About -Change to Link Aftwards</p>
    </header>
  );
};
const ArtistBlender = () => {
  return <h1 className="artistblender">ArtistBlender</h1>;
};

const App = () => {
  return (
    <main className="app">
      <ArtistBlender />
    </main>
  );
};

export default App;
